import React from 'react';
import './App.css';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom'
import HomePage from './Component/User/HomePage'

function App() {
  return (
    <Router>
      <div className="App">
        <switch>
          <Route exact path='/' component={HomePage} />
        </switch>
      </div>
    </Router>
  );
}

export default App;
